class CASLineSignal(TextualConvention, OctetString):
    description = "This textual convention defines line signals indicating the ABCD bits of CAS signaling, which represent the states of lines. Each of A, B, C or D represents by two bit value : b(bit)1 | b0 | value ------------------------ 0 | 0 | 0 0 | 1 | 1 1 | 0 | 2 ( don't care ) 1 | 1 | 3 ( don't care ) The ABCD line signals are occupied in one byte, and in order: . A : bit 7, and 6 . B : bit 5, and 4 . C : bit 3, and 2 . D : bit 1, and 0 A | B | C | D ----------------------------------------- | b1 | b0 | b1 | b0 | b1 | b0 | b1 | b0 | ----------------------------------------- MSB 7 LSB 0 "
    status = 'current'
    subtypeSpec = OctetString.subtypeSpec + ValueSizeConstraint(1, 1)
    fixedLength = 1

class CASRegisterSignal(TextualConvention, Integer32):
    description = 'This textual convention defines Register Signaling. Signals (tones) sent from the calling party to the called party are called forward register signals. Signals (tones) sent from the called party to the calling party are backward register signals. Incoming registers (for incoming calls), receive forward register signals and return backward register signals. . In compelled register signaling, the backward signal sent out of the incoming register in response to a forward register signal stays on until the forward register signal sent from the other end (outgoing register) is turned off. Compelled signaling should not be used over satellite links due to latency. . In non-compelled and semi-compelled register signaling, the backward signals sent from the incoming register towards the other end (outgoing register) are pulses and not continuous. Outgoing registers (for outgoing calls) : send forward register signals and receive backward register signals. . In compelled and semi-compelled register signaling, when a forward signal is sent, the tones stay on until the other end responds with the backward signal that signals the calling party to turn off the forward tone. The next forward tone is sent only after the backward tone has been turned off from the other end (incoming register). Compelled signaling should not be used for satellite links. . In non-compelled signaling, the calling party sends the forward signals as pulses. That is, they are on for a short duration. '
    status = 'current'
    subtypeSpec = Integer32.subtypeSpec + ConstraintsUnion(SingleValueConstraint(1, 2, 3))
    namedValues = NamedValues(("compelled", 1), ("noncompelled", 2), ("semicompelled", 3))

