if mibBuilder.loadTexts: ccasIfExtDs0GrpRepetition.setDescription('This object is used to repeatedly apply the writable objects of ccasIfExtDs0GrpCfgTable specified in the same SNMP PDU starting from the row specifies by the index of the instance for the number of rows specified in this object. The repetition operation works differently for different DS0 channel bitmap configuration. When the DS0 channel bitmap is configured to contain a single DS0 channel, the order of operation is iterated through the value of DS0 group and the logical order of DS0 channel; When the DS0 channel bitmap is configured to contain more than one DS0 channels, the order of operation is iterated through logical order of DS1 channel, and all the iteration operations use the same DS0 channel bitmap configuration. The repetition iteration will stop once the value of iterated value reaches its maximum limit. In the case of a single DS0 channel configuration, the repetition will stop when either the value of the DS0 group or the DS0 channel has reached its maximum. For multiple DS0 channel configuration, the repetition will stop once the value of DS1 reaches its maximum. ')
