if mibBuilder.loadTexts: ccasGCnfGlarePolicy.setDescription('This object specifies a glare policy. It is used only if CAS DS0 directionality of the endpoint is bidirectional, and is applicable for non R2 variants. . rptSzOnGlareTmrExp (1): When glare is detected, the GW will wait for the timeout value specified in the glare timer object or until incoming call attempt is removed by the other exchange/switch. If the far end does not back off due to wrong configuration, and the GW times out, it reports the seize event to the controlling application. . rptSzOnGlareDet (2): When glare is detected, the GW will signal the seizure event to the controlling application. . rptRelOnGlareTmrExpAndGoOnHook (3): When glare is detected, the GW will wait for the timeout value specified in the glare timer object OR until incoming call attempt is removed by the other exchange/switch. If the far end does not back off, due to wrong configuration, and the GW times out, it reports the release event and goes onhook, upon detection of on hook from the far end the GW will send the rlc event to the controlling application. . goOnHookOnGlareDet (4): When glare is detected, the GW will go on hook and let the far end switch continue. ')
